import React from 'react';
import s from './Navbar.module.css';
import {NavLink} from "react-router-dom";

const Navbar = ({state}) => {
    return <nav className={s.nav}>
        {state.navData.map((data) => (
            <div className={s.item}>
                <a href={'/' + data.href.toLowerCase()} className={s.itemLink}>
                    <span className={s.linkWrap}>
                    <span className={s.navbarItemImg + ' ' + data.href.toLowerCase()}></span>
                    <span className={s.linkName}>{data.href}</span>
                    </span>
                </a>
            </div>
        ))}
    </nav>
}

export default Navbar;
